--
-- Table structure for table `location`
--

DROP TABLE IF EXISTS `location`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `location` (
  `id` int NOT NULL AUTO_INCREMENT COMMENT 'Unique identifier for the location',
  `name` varchar(80) NOT NULL COMMENT 'Name of the location (e.g., city, state, province)',
  `parent_id` int DEFAULT NULL COMMENT 'Reference to the parent location (e.g., a province might have a country as its parent)',
  `code` varchar(2) DEFAULT NULL COMMENT 'Short code representing the location',
  `display_name` varchar(200) DEFAULT NULL COMMENT 'Display name for the location (formatted for user interface)',
  `search_name` varchar(200) DEFAULT NULL COMMENT 'Searchable name for the location (used in search algorithms)',
  `slug` varchar(200) DEFAULT NULL COMMENT 'URL-friendly version of the location name',
  `capital_id` int DEFAULT NULL COMMENT 'ID of the capital city associated with this location',
  `latitude` double DEFAULT NULL COMMENT 'Latitude coordinate of the location',
  `longitude` double DEFAULT NULL COMMENT 'Longitude coordinate of the location',
  `children_count` int DEFAULT NULL COMMENT 'Number of child locations (e.g., districts under a province)',
  `level` smallint DEFAULT NULL COMMENT 'Level of the location in the hierarchy (e.g., country = 1, state = 2, city = 3)',
  `adecsys_id` int DEFAULT NULL COMMENT 'Identifier used in the Adecsys system for this location',
  `ad_count` int NOT NULL DEFAULT '0' COMMENT 'Number of ads or listings related to this location',
  `index_name` varchar(200) NOT NULL COMMENT 'Name used for indexing in search engines (e.g., JavaLucene)',
  `country_code` int DEFAULT '0' COMMENT 'Country code of the location',
  `department_code` int DEFAULT '0' COMMENT 'Department code of the location',
  `province_code` int DEFAULT '0' COMMENT 'Province code of the location',
  `district_code` int DEFAULT '0' COMMENT 'District code of the location',
  `status` tinyint(1) DEFAULT '1' COMMENT 'Status of the location (active or inactive)',
  PRIMARY KEY (`id`),
  KEY `parent_id` (`parent_id`),
  KEY `idx_location_country_code` (`country_code`),
  KEY `idx_location_department_code` (`department_code`),
  KEY `idx_location_province_code` (`province_code`),
  KEY `idx_location_district_code` (`district_code`)
) ENGINE=InnoDB AUTO_INCREMENT=4776 DEFAULT CHARSET=utf8mb3;
/*!40101 SET character_set_client = @saved_cs_client */;

--
-- Dumping data for table `location`
--

