DROP TABLE IF EXISTS `user_company`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `user_company` (
  `id` int NOT NULL AUTO_INCREMENT COMMENT 'Unique identifier for the user-company relation',
  `user_id` int NOT NULL COMMENT 'Identifier for the user',
  `company_id` int NOT NULL COMMENT 'Identifier for the company',
  `first_name` varchar(100) NOT NULL COMMENT 'User first name',
  `last_name` varchar(100) NOT NULL COMMENT 'User last name',
  `email` varchar(100) NOT NULL COMMENT 'User email address',
  `phone` varchar(20) DEFAULT NULL COMMENT 'User contact phone number',
  `role` enum('admin','employee','manager') DEFAULT 'employee' COMMENT 'User role within the company',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Record creation date',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Record last update date',
  `status` tinyint(1) DEFAULT '1' COMMENT 'Status of the user-company relation (1 for active, 0 for inactive)',
  PRIMARY KEY (`id`),
  KEY `user_id` (`user_id`),
  KEY `company_id` (`company_id`),
  CONSTRAINT `FK_company` FOREIGN KEY (`company_id`) REFERENCES `company` (`id`) ON DELETE CASCADE,
  CONSTRAINT `FK_user` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COMMENT='Table to link users with their respective companies';
